import "./Thank.css";

const Thank = () => {
  return (
    <div className="Filling">
      <div className="Thank-responsive-background">
        <div className="Thank-logo">
          <img src={Logo} alt="" />
        </div>
        <div className="Thank-top-text">Let's Reduce and Reuse plastics</div>
      </div>
    </div>
  );
};

export default Thank;
